import React from "react";
import NavigationPage from "./NavigationPage";
import { Link } from "react-router-dom";

class HomePage extends React.Component {
    constructor(props) {
        super();
    }

    render() {
        return (
            <div className="bg-secondary">
                <NavigationPage project="React Training"></NavigationPage>
                <ul>
                    <li><Link to="props-demo">Props in ReactJS</Link></li>
                    <li><Link to="state-demo">State in React JS</Link></li>
                    <li><Link to="lifecycle-demo">Life Cycle of React Component</Link></li>
                </ul>
            </div>
        );
    }

}

export default HomePage;
